-- Initiating the database
USE [EventSphere Database];



-- 7.Event

-- inserting a few more data points for future


-- Updating Venue_ID and Capacity for Virtual and Webinar Events

UPDATE [dbo].[Event]
SET [venue_ID] = 757 -- Online 
WHERE [event_Type_ID] IN (200, 205) -- Virtual and Webinar Events


/*

This block of code produces random numbers to populate the remaining columns of the Event table :[end_date],[budget_estimated],[budget_actual], 
[estimated_attendance] and [actual_attendance] columns. By changing a few values in the template, I was able to insert values based on various types of events.

*/


/*
Explanation of the code:

A) CTE (Common Table Expression): This part selects the rows and calculates the row number and total number of rows in the table. This is used to determine
which rows should have their end_date set to start_date.

B) Random Values: The CHECKSUM(NEWID()) function is used to generate random values. The ABS() function ensures positive values, and the modulus operator % is 
used to confine the random values within the specified range.

C) Customization:
	- Replace [specific value] with the actual percentage value (e.g., 20 for 20%)
	- Replace [minimum value] and [maximum value] with the range of values you want to use for budget_estimated and estimated_attendance.
*/


-- Updating end_date values that will depend on the start_date.

WITH CTE AS ( -- This part selects the rows and calculates the row number and total number of rows in the table. This is used to determine which rows should have their end_date set to start_date.
    SELECT 
        *,
        ROW_NUMBER() OVER (ORDER BY NEWID()) AS RowNum,
        COUNT(*) OVER () AS TotalRows
    FROM 
        [dbo].[Event]
	WHERE 
		[event_Type_ID] = [insert event_type_id] -- insert 1
)
UPDATE CTE
SET [end_date] = CASE 
                    WHEN RowNum <= (TotalRows * 55 / 100) THEN DATEADD(DAY, 4, [start_date]) -- Can change the end date value here
					WHEN RowNum <= (TotalRows * 80 / 100) THEN DATEADD(DAY, 2, [start_date]) -- Can change the end date value here
					ELSE DATEADD(DAY,3, [start_date])-- Can change the end date value here
                 END;



-- Update estimated_budget with random values
UPDATE [dbo].[Event]
SET 
    [estimated_budget] = ROUND([minimum value] + (ABS(CHECKSUM(NEWID())) % ([maximum value] - [minimum value] + 1)), 0) -- insert 2
	-- The CHECKSUM(NEWID()) function is used to generate random values. The ABS() function ensures positive values, and the modulus operator % is used to confine the random values within the specified range (minimum and maximum values).
WHERE 
	[event_Type_ID] = [insert event_type_id] -- insert 1;




-- Update estimated_attendance with random values
UPDATE [dbo].[Event]
SET 
    [estimated_attendance] = ROUND([minimum value] + (ABS(CHECKSUM(NEWID())) %([maximum value] - [minimum value] + 1)), 0) --insert 3
	-- The CHECKSUM(NEWID()) function is used to generate random values. The ABS() function ensures positive values, and the modulus operator % is used to confine the random values within the specified range (minimum and maximum values).
WHERE 
	[event_Type_ID] = [insert event_type_id] -- insert 1;








-- Since the actual_budget and actual_attendance will be close to the estimated_budget and estimated_attendance, I've updated them with a variation of 0% to 25% of .

/*
Explanation of the code:

A) Random Variation Calculation: CAST(ABS(CHECKSUM(NEWID())) % 6 AS FLOAT) / 100.0 calculates a random percentage between 0% and 5%.

B) Random Addition or Subtraction: CASE WHEN ABS(CHECKSUM(NEWID())) % 2 = 0 THEN 1 ELSE -1 END randomly determines whether to add (1) or subtract (-1) the
calculated percentage.

C) Final Adjustment: The random percentage is either added to or subtracted from budget_estimated or estimated_attendance, resulting in budget_actual and 
actual_attendance being either slightly higher or lower than the estimated values.

This modification ensures that the actual values can be both slightly above or below the estimated values, introducing realistic variability.
*/

-- Update budget_actual based on budget_estimated with a variation of 0% to 5% 

UPDATE [dbo].[Event]
SET 
    [total_expenditure] = ROUND(estimated_budget * 
                        (1 + 
                        ((CAST(ABS(CHECKSUM(NEWID())) % 5 AS FLOAT) / 100.0) * -- can change the % of values here
                        CASE WHEN ABS(CHECKSUM(NEWID())) % 2 = 0 THEN 1 ELSE -1 END)), 0) -- can change the % of values here
 WHERE [event_Type_ID] = [insert event_type_id] -- insert 1
 ;


-- Update actual_attendance based on estimated_attendance with a variation of 0% to 5%
UPDATE [dbo].[Event]
SET 
    [actual_attendance] = ROUND([estimated_attendance] * 
                            (1 + 
                            ((CAST(ABS(CHECKSUM(NEWID())) % 5 AS FLOAT) / 100.0) * -- can change the % of values here
                            CASE WHEN ABS(CHECKSUM(NEWID())) % 2 = 0 THEN 1 ELSE -1 END)), 0)-- can change the % of values here
 WHERE [event_Type_ID] = [insert event_type_id] -- insert 1
;



-- Updating the Status Field with 60% of the records as 'Completed', 15% as 'Cancelled' and the rest as 'Rescheduled' 
WITH CTE AS (
    SELECT 
        *,
        ROW_NUMBER() OVER (ORDER BY NEWID()) AS RowNum,
        COUNT(*) OVER () AS TotalRows
    FROM 
        [dbo].[Event]
)
UPDATE CTE
SET Status = CASE 
                    WHEN RowNum <= (TotalRows * 60 / 100) THEN 'Completed' 
					WHEN RowNum <= (TotalRows * 75 / 100) THEN 'Cancelled'
					ELSE 'Rescheduled'
              END; 
 

-- Since for cancelled events there would be no actual_attendance and total_expenditure, so I'll set them to 0
UPDATE [dbo].[Event]
SET [actual_attendance] = 0
WHERE [status] = 'Cancelled'

UPDATE [dbo].[Event]
SET [total_expenditure] = 0
WHERE [status] = 'Cancelled'



-- Adjusting the capacity of venues based on estimated_attendance of event table 
-- There were a few records in event table whose attendee count exceeded the venue's capacity.
-- Therefore, I updated the Venue's capacity by adding a margin of 50 to the estimated count of attendees.

WITH CTE AS
(
SELECT v.*, 
	e.[estimated_attendance],
	attendence = e.estimated_attendance + 50
FROM 
	Event e 
JOIN 
	[dbo].[Venue] v ON v.venue_ID = e.venue_ID 
WHERE
	e.estimated_attendance > v.capacity
)
UPDATE CTE
SET capacity = attendence;


SELECT * FROM Event;